toscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"525458","type":"CustomJS"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"glyph_width":0,"group":null,"items":[{"id":"525453"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"525452","type":"Legend"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"point_policy":"follow_mouse","renderers":[{"id":"525304"}],"tooltips":[["Date","@datetime{%c}"],["Size","@size{0,0}"],["P/L","@returns_short{+0.[000]%}"]]},"id":"525308","type":"HoverTool"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"525353"},"group":null,"major_label_policy":{"id":"525522"},"minor_tick_line_color":null,"ticker":{"id":"525325"}},"id":"525324","type":"LinearAxis"},{"attributes":{"coordinates":null,"data_source":{"id":"525107"},"glyph":{"id":"525370"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"525372"},"nonselection_glyph":{"id":"525371"},"view":{"id":"525374"}},"id":"525373","type":"GlyphRenderer"},{"attributes":{},"id":"525448","type":"AllLabels"},{"attributes":{"coordinates":null,"formatter":{"id":"525444"},"group":null,"major_label_policy":{"id
